import React from "react";
import "./Guess.scss";
import picShow4 from "../../images/show4.jpg";
import picShow5 from "../../images/show5.jpg";
import picShow6 from "../../images/show6.jpg";

export function Guess() {
  return (
    <>
      <section className="sectionContainer">
        <div className="sectionContainerTitle">猜您也喜歡</div>
        <div className="guesses">
          <div className="guesseItem">
            <img className="guessePic" src={picShow4} alt="guesse pic" />
            <div className="guesseTitle">No.22 線上設計展</div>
            <div className="guessePrice">$350</div>
          </div>
          <div className="guesseItem">
            <div
              className="guessPic"
              style={{
                backgroundSize: "cover",
                background:
                  "url(https://images.unsplash.com/photo-1566954979172-eaba308acdf0?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1631&q=80)",
              }}
            ></div>
            {/* <img className="guessePic" src={picShow5} alt="guesse pic" /> */}
            <div className="guesseTitle">No.22 線上設計展</div>
            <div className="guessePrice">$350</div>
          </div>
          <div className="guesseItem">
            <img className="guessePic" src={picShow6} alt="guesse pic" />
            <div className="guesseTitle">No.22 線上設計展</div>
            <div className="guessePrice">$350</div>
          </div>
        </div>
      </section>
    </>
  );
}
